import React from "react"
import styled from "styled-components"
import { Container, Title } from "./contants"
const Wrapper = styled.ul``
const Item = styled.li``
const Name = styled.p``
const API = [
  {
    name: "BR_Wrongnumber",
    icon: "",
    check: true,
  },
  {
    name: "Agnt_ConfirmedDueAmnt",
    icon: "",
    check: true,
  },
  {
    name: "NotifyPayment DueDate",
    icon: "",
    check: true,
  },
  {
    name: "CollAgentScriptAdherence",
    icon: "",
    check: true,
  },
  {
    name: "CollAgentScriptAdherence",
    icon: "",
    check: true,
  },
  {
    name: "CollAgentScriptAdherence",
    icon: "",
    check: true,
  },
]
const Alerts = () => {
  return (
    <Container>
      <Title>Alerts</Title>
      <Wrapper>
        {API.map((item) => (
          <Item>
            <Name>{item.name}</Name>
          </Item>
        ))}
      </Wrapper>
    </Container>
  )
}

export default Alerts
